msg.workStart = Date.now();

msg.isRequest = true;
msg.isNOA = false;
if(msg.payload.noa !== undefined)
msg.isNOA = true;

if(env.get("ENVIRONMENT") !== undefined) 
    msg.workDir = env.get("ENVIRONMENT").substring(0,3).toUpperCase();

/*
if (msg.req.headers['x-auth-token'] !== 'c8ER/H9%p=";7`:}S%jU<A.eZ@$!BQwn') {
    node.error("Unauthorized", msg);
}
*/
if (msg.payload  === undefined)
{
    node.error("Не заданы параметры запроса ....", msg);
} else {
    msg.in = {};
    msg.out = {};
    msg.in.bankid_cli = msg.payload;
    return msg;
}

var workTime = 0;
msg.workStop = Date.now();
workTime = (msg.workStop - msg.workStart) / 100;
msg.workTime = 'Work time is: '+workTime +' msec.';

var data = msg.payload;
if(data.length !== 0){
    msg.statusCode = 200;
    msg.payload = {
        code : '200',
        result : 'ok',
        time: msg.workTime,
        path: msg.req.route.path,
        data : data
    }
    return msg;
} else {
    msg.statusCode = 200;
    msg.payload = {
        code : '402',
        message : 'empty',
        workTime: msg.workTime,
        error: "No data for request",
        data : []
    }
    return msg
}

